import './App.css';
import { Menu, RightSection } from './Components';
import { createBrowserRouter, RouterProvider } from 'react-router-dom';

function App() {
  const router = createBrowserRouter([
    {
      path: "/attendence",
      element: <><Menu/><RightSection/></>
    },
    {
      path: "/leave",
      element: <><Menu/></>
    },
  ])

    return (
        <>
          <RouterProvider router={router} />
        </>
    );
}

export default App;
